def project = testRunner.testCase.testSuite.getProject()
def currentSuite = testRunner.getTestCase().getTestSuite().name
def currentTestCase= testRunner.getTestCase().name
def currentTestStepName = context.testCase.getTestStepAt(context.getCurrentStepIndex()).getLabel()
def testSuite = testRunner.testCase.getTestSuite()

//Post Batch run validation started for all the disabled testcases
log.info "Post Batch run validation started for all the disabled testcases!!"
def resultSuite  = ""

def a = testSuite.testCaseList.each{ eachTestCase ->
	testCaseNameTemp = eachTestCase.name
	def resultCase = ""
	if( eachTestCase.hasProperty("postTestCaseValidation") && eachTestCase.getPropertyValue('status').equals("PASS") && !eachTestCase.isDisabled() ){		
		def testCasetemp  = eachTestCase
		def transactionId = testCasetemp.getPropertyValue("transactionId")
		def endToEndId = testCasetemp.getPropertyValue("endToEndId")
		def kriterieType = testCasetemp.getPropertyValue("kriterieType")

		//def transactionId = testCasetemp.getPropertyValue("transactionsIds")
		def ExpectedStatus = testCasetemp.getPropertyValue("expectedPmtStatus")
		//def transactionIds = transactionId.replaceAll("\\[|\\]",'')

		testRunner.getTestCase().getTestStepByName("Properties").setPropertyValue("transactionId",transactionId)
		testRunner.getTestCase().getTestStepByName("Properties").setPropertyValue("endToEndId",endToEndId)
		testRunner.getTestCase().getTestStepByName("Properties").setPropertyValue("kriterieType",kriterieType)

			def testStepInclusionList = ['TRANSACTIONS_PostBatch','RBS_HistoricCheck','RemoveFraudFlag','TRANSACTIONS_PostRemoveFlag']
			// run post batch run validation for each disbled testcase
			testRunner.getTestCase().getTestStepList().each{ testStep ->					
					def testStepTemp = testStep.name
					def resultStep = ""
					if(testStepInclusionList.contains(testStepTemp)){							
							def stepRunner = testRunner.runTestStepByName(testStepTemp)								
							try{System.sleep(1000)}catch(Exception e){}					
							if((stepRunner == null) || (stepRunner.status.toString() != 'PASS')){									
								def StepErrorMessage = "failed to run step $testStepTemp"	
								if (stepRunner != null) StepErrorMessage = stepRunner.getMessages().toString() 
								resultStep = resultStep +" : Failed testStep = " + testStepTemp + " : Failed Reason" + StepErrorMessage + "\n "
								resultCase = resultCase  + resultStep								
							}
					}					
			}
			if(resultCase.trim() != ""){
				resultCase = "\n************************FAILED TESTCASE DETAILS*********************\n"  + "Failed TestCase =" + testCaseNameTemp + "\n" + resultCase 
				resultSuite = resultSuite  +   resultCase	 + "\n"

			}

	}	

}

log.info "resultSuite error log-->" + resultSuite
if(resultSuite.trim() != "")
	assert false, resultSuite

